<template>
	<view>
		<view class="header">
			<view class="header-wrap">
				<view class="header-wrap-avator">
					<img :src="imgUrl" alt="" />
					<open-data v-if="userinfo.name" type="userAvatarUrl"></open-data>
				</view>

				<view v-if="token && userinfo">
					<view class="personInfo">
						<text class="name">{{ userinfo.name | ellipsis }}  </text>
						<text class="number">{{ userinfo.telephone }}</text>
					</view>
					<view class="Info">
						<text @click="undateInfo">修改资料</text>
					</view>
				</view>

				<view v-else class="header-wrap-action">
					<!-- <text @click="goTo('login')">登录 </text> -->
					<button  class="header-wrap-action-login" open-type="getPhoneNumber" @getphonenumber="handleLogin" @click="getCode">登录</button>
					<button class="header-wrap-action-login">{{" "}} / 注册</button>
				</view>

			</view>
		</view>

		<view class="my-main">
			<view class="my-main-items">
				<view class="my-main-item my-icon-card" @click="toDetail('xx')">个人资料</view>
				<view class="my-main-item my-icon-message" @click="toDetail('xx')">我的消息</view>
				<view class="my-main-item my-icon-setting" @click="toDetail('xx')">帮助与反馈</view>
				<view class="my-main-item my-icon-notification" @click="toDetail('xx')">应用分享</view>
				<view class="my-main-item my-icon-setting" @click="toDetail('site')">
					<view>设置</view>
					<!-- <uni-icons type="arrowright" size="16"></uni-icons> -->
				</view>
			</view>
		</view>
	</view>



	<!-- <view @click="logOut">退出登录</view> -->
</template>

<script>
	import {
		mapState,
		mapActions,
		mapMutations
	} from 'vuex';
	export default {
		data() {
			return {
				imgUrl: '/static/avator.png',
				code: ''
			};
		},
		computed: {
			...mapState('user', ['userinfo', 'token']),
			...mapState('communityServ',['communityId']),
			avatar() {
				return this.userinfo.avatar
			}
		},
		onShow() {
			// this.getUserinfo()
			uni.getStorage({
				key: 'userinfo',
				success: function(res) {
					if (!res.data) {
						uni.navigateTo({
							url: '../login/login'
						})
					}
				}
			});
		},
		filters: {
			ellipsis(value) {
				if (!value) return ''
				if (value.length > 8) {
					return value.slice(0, 8) + '...'
				}
				return value
			}
		},
		methods: {
			...mapActions('user', ['getUserinfo', 'getToken', 'wechatLogin']),
			...mapActions('communityServ',['getList','switchCommunityDataSource','getIndexStatisticsDataForPolice']),
			...mapMutations('user', ['setToken', 'setUserinfo']),
			goTo: route => {
				uni.navigateTo({
					url: `../login/${route}`
				})
			},
			async handleLogin(e) {
				const {
					errMsg,
					encryptedData,
					iv
				} = e.detail;
				
				if (errMsg === 'getPhoneNumber:ok') {
					const token = await this.wechatLogin({
						code: this.code,
						role: 'police',
						encryptedData,
						iv
					});
					if (token) {
						uni.showToast({
							title: '登录成功'
						});
						this.getUserinfo();
						this.getList()
					
						this.switchCommunityDataSource({
							id:  this.communityId
						})
						this.getIndexStatisticsDataForPolice()
						uni.switchTab({
							url:'../community-serv/communityServ'
						})
					}
				}

			},
			//获取微信校验code
			getCode() {
				uni.login({
					success: loginResult => {
						if (loginResult.code) {
							this.code = loginResult.code
						}
					}
				})
			},
			undateInfo() {
				uni.showToast({
					title: '该功能暂不开放',
					icon: 'none',
				});
			},
			toDetail(key) {
				// if (!this.token) {
				// 	uni.navigateTo({
				// 		url: '../login/login'
				// 	})
				// 	return null;
				// }
				if (key === 'site') {
					uni.getStorage({
						key:'userinfo',
						success: function(res) {
							if (res.data) {
								uni.navigateTo({
									url: './user-site'
								})
							}
						},
						fail:function(){
							uni.showToast({
								title:'请登录',
								icon: 'none'
							})
						}
					})
				} else {
					uni.showToast({
						title: '该功能暂不开放',
						icon: 'none',
					});
				}
			}
		},

	};
</script>

